css:
@-moz-document domain("itslearning.com") {
    /* Set background color of body */
    body {
        background-color: #1d1d1d !important;
    }
    
    /* Set background color and text color of header */
    .osl-global-header {
        background-color: #2d2d2d !important;
        color: #dcdcdc !important;
    }
    
    /* Set background color and text color of footer */
    .osl-global-footer {
        background-color: #2d2d2d !important;
        color: #dcdcdc !important;
    }
    
    /* Set background color and text color of main content */
    .osl-content-body {
        background-color: #1d1d1d !important;
        color: #dcdcdc !important;
    }
    
    /* Set text color of links */
    a {
        color: #ffffff !important;
    }
}
